import './experience.css';
export default function Experience({company, position, year}) {
    const experience = [
        {
            company: "VuckoCo",
            position: "Software Engineer",
            year: "2023"
        },
        {
            company: "Nausal Technologies",
            position: "Software Engineer",
            year: "2022"
        },
        {
            company: "Google LLC",
            position: "DevOps",
            year: "2023"
        }
    ];
    return (
        <div className="experienceContainer">
            <table className="experienceTable">
                <tr>
                    <th>Company</th>
                    <th>Position</th>
                    <th>Year</th>
                </tr>
                <tr>
                    <td>{company}</td>
                    <td>{position}</td>
                    <td>{year}</td>
                </tr>
                <tr>
                    <td>{company}</td>
                    <td>{position}</td>
                    <td>{year}</td>
                </tr>
                <tr>
                    <td>{company}</td>
                    <td>{position}</td>
                    <td>{year}</td>
                </tr>

            </table>

        </div>
    );
}
